signatures: >-
  executeAgentCommand(agentDirectoryPath: string, args: string[]) :
  Promise.<string> - Executes a specified faqtiv CLI command in a given agent
  directory. Returns a promise that resolves to the command's standard output or
  standard error as a string.

  fetchYamlApiSpec(apiUrl: string) : Promise.<Object> - Fetches and parses an
  API specification from the provided URL using Swagger-Parser. Returns a
  promise that resolves to the parsed API spec object.
